import { BrowserRouter, Router } from "react-router-dom";
import Home from "./components/Home";
import Navbar from "./components/Navbar";
function App() {
  return (
    <>
      <BrowserRouter>
        <Navbar></Navbar>
        <Home></Home>
      </BrowserRouter>
    </>
  );
}

export default App;
